/// <reference types="jest" />

import {parseCIGARSections} from "./../lib/lib";

it(`should not parse CIGAR 1`,() => {
    let res = parseCIGARSections("");

    expect(res).toBeUndefined();
});

it(`should not parse CIGAR 2`,() => {
    let res = parseCIGARSections("*");

    expect(res).toBeUndefined();
});

it(`should not parse CIGAR 3`,() => {
    let res = parseCIGARSections("TGGAGTATGATGACCAGTTAGGATGGAGGATCAGATTGGAGTTGGGTTAGAGATGGGGTAAAATTGTGCTCCGGATGAGTTTGGGATTGACACTGTGGAGGTGGTTTGGGATGGCATGGCTTTGGGATGGAAATAGATTTGTTTTGATGTT");

    expect(res).toBeUndefined();
});

it(`should correctly parse CIGAR 1`,() => {
    let res = parseCIGARSections("151M");
    
    expect(res).toBeDefined();
    expect(res!.length).toBe(1);
    expect(res![0].op).toBe("M");
    expect(res![0].val).toBe(151);
});


it(`should correctly parse CIGAR 2`,() => {
    let res = parseCIGARSections("7M15I129M");
    
    expect(res).toBeDefined();
    expect(res!.length).toBe(3);
    expect(res![0].op).toBe("M");
    expect(res![0].val).toBe(7);
    expect(res![1].op).toBe("I");
    expect(res![1].val).toBe(15);
    expect(res![2].op).toBe("M");
    expect(res![2].val).toBe(129);
});

it(`should correctly parse CIGAR 3`,() => {
    let res = parseCIGARSections("129M3I7M6I6M");
    
    expect(res).toBeDefined();
    expect(res!.length).toBe(5);
    expect(res![0].op).toBe("M");
    expect(res![0].val).toBe(129);
    expect(res![1].op).toBe("I");
    expect(res![1].val).toBe(3);
    expect(res![2].op).toBe("M");
    expect(res![2].val).toBe(7);
    expect(res![3].op).toBe("I");
    expect(res![3].val).toBe(6);
    expect(res![4].op).toBe("M");
    expect(res![4].val).toBe(6);
});

it(`should correctly parse CIGAR 4`,() => {
    let res = parseCIGARSections("118M14I13M1I5M");
    
    expect(res).toBeDefined();
    expect(res!.length).toBe(5);
    expect(res![0].op).toBe("M");
    expect(res![0].val).toBe(118);
    expect(res![1].op).toBe("I");
    expect(res![1].val).toBe(14);
    expect(res![2].op).toBe("M");
    expect(res![2].val).toBe(13);
    expect(res![3].op).toBe("I");
    expect(res![3].val).toBe(1);
    expect(res![4].op).toBe("M");
    expect(res![4].val).toBe(5);
});

it(`should correctly parse CIGAR 4`,() => {
    let res = parseCIGARSections("126M4D11M4I10M");
    
    expect(res).toBeDefined();
    expect(res!.length).toBe(5);
    expect(res![0].op).toBe("M");
    expect(res![0].val).toBe(126);
    expect(res![1].op).toBe("D");
    expect(res![1].val).toBe(4);
    expect(res![2].op).toBe("M");
    expect(res![2].val).toBe(11);
    expect(res![3].op).toBe("I");
    expect(res![3].val).toBe(4);
    expect(res![4].op).toBe("M");
    expect(res![4].val).toBe(10);
});

//htslib, and by extension, samtools only support CIGAR strings of size 2^16. Ensure we can support at least ~2^18.5
it(`should correctly parse CIGAR 5`,() => {
    let res = parseCIGARSections("");
    
    expect(res).toBeDefined();
    expect(res!.length).toBe(371200);

    for(let i = 0; i != 371200; i += 5)
    {
        expect(res![i].op).toBe("M");
        expect(res![i].val).toBe(126);
        expect(res![i+1].op).toBe("D");
        expect(res![i+1].val).toBe(4);
        expect(res![i+2].op).toBe("M");
        expect(res![i+2].val).toBe(11);
        expect(res![i+3].op).toBe("I");
        expect(res![i+3].val).toBe(4);
        expect(res![i+4].op).toBe("M");
        expect(res![i+4].val).toBe(10);
    }

});